import Slider from "react-animated-slider";
import "react-animated-slider/build/horizontal.css";
import poster1 from "../assets/poster1.png";
import poster2 from "../assets/poster2.png";
import React from "react";

function Card() {
  console.log("in card");
  const slides = [
    { title: "img", media: poster1 },
    { title: "img", media: poster2 },
    { title: "vid", media: `url(https://www.youtube.com/embed/KV4wctXNwhA)` },
  ];
  return (
    <div>
      <Slider>
        {slides.map((slide, index) => {
          if (slide.title === "img") return <img src={slide.media} alt="poster" />;
          else
          return
            <iframe
              width="1293"
              height="480"
              src={slide.media}
              title="Anna Dhanam | Food Donation | అన్న దానం | التبرع بالطعام | Free Food | Street Food Planet"
              frameborder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowfullscreen
            ></iframe>;
        })}
      </Slider>
    </div>
  );
}

export default Card;
